import axios from 'axios'

app.get("/parafin/token/:id", async (req, res) => {
  const url = "https://api.parafin.com/auth/redeem_token"
  const personId = req.params.id
  const data = {
    person_id: "person_f27ccf05-aada-4348-bbcb-11ca672a8b59"
  }
  const config = {
    auth: {
      username: "e739d6c5-70ed-4ffd-9117-1ec7ad5f29f2",
      password: "sandbox_WMheEpcCf6bfFkUXNBf8526SasjeHYEoYnKp62Y9I9L4Cb7Q3t2p5c87jyc2UxRO",
    }
  }
  const result = await axios.post(url, data, config)

  res.send({
    parafinToken: result.data.bearer_token
  });
  console.log('Token:', parafinToken);
});
